Headed down to the waterfront for a day of
                        caching, benchmarking and letterboxing&nbsp;
                        Made the find after a short search&nbsp;
                        Everything was fine and dandy&nbsp; I had
                        an enjoyable day despite the omnipresent
                        stiff wind&nbsp; TFTC

Just couldn't find a good way in&nbsp;
                        My son got out with me this time, but (of
                        course) he's wearing flip flops&nbsp;
                        Maybe when I come back in the fall
                        (hopefully), the way will be more welcoming

                        &nbsp;

Made a quick find on Super Bowl Sunday&nbsp;
                        Enjoyed a warm sunny day in WNY&nbsp;
                        Thanks for placing this one

Figured this would be easier to log than
                        the webcam since log books don't break&nbsp;
                        It wasn't full so I signed in and looked
                        around a bit&nbsp; Nice sunny day for a
                        walk on the canal &nbsp;&nbsp;

I do have another cache at the upper falls&nbsp;
                        Coords located on a neighboring competitor
                        website&nbsp; Enjoy!!

Flocked down here to today and made a quick
                        find&nbsp; I always enjoy my time here&nbsp;
                        TFTC

This was my favorite trail in the park&nbsp;
                        I love the pine forests and the soft pine
                        needle strewn trail&nbsp; I really
                        enjoyed myself in the park today&nbsp;
                        thanks for getting some caches in this great
                        park&nbsp; TFTC!

Finally made it back here to avenge and
                        early DNF on this cache awhile ago&nbsp;
                        Walked right up to it today and found it in
                        seconds&nbsp; I can't believe how some
                        caches just do that sometimes!!!&nbsp;&nbsp;
                        Drives me crazy!!&nbsp; Cache is in great
                        shape here and is ready to be found again&nbsp;
                        Nicely done Sabre and TFTC!!!

Woo hoo!&nbsp; FTF baby! Our first FTF
                        on an OCUS cache! Never logged a BIT cache
                        before, either! Good thing we had a snowbrush
                        in the truck still or we would've never been
                        able to have reached it! Phew!&nbsp;
                        Hopefully, retrieval will be easier for the
                        next finder&nbsp; TFTC!!

                        &nbsp;

                        &nbsp;

                        &nbsp;

Took a walk on the pier today&nbsp; I
                        have been meaning to take a walk here for
                        many years and finally got around to it today&nbsp;
                        It was a great day for a walk here&nbsp;
                        It was a little hazy but we still had great
                        views&nbsp; I found all 7 of this series&nbsp;
                        TFTC

Good morning! &nbsp;It's bright and
                        sunny and I'm enjoying a stretch of the legs
                        along the break wall&nbsp;

Thanks to all who have stopped by so far&nbsp;
                        The old, archived cache is gone&nbsp; The
                        container was damaged and leaking badly&nbsp;
                        The post-archive logs were a wad of soaked
                        paper&nbsp; The "new" OC cache is in the
                        same place so it's a replacement&nbsp;
                        Since the old one cannot be brought back due
                        to proximity issues with other GC caches I
                        thought it was best to "Trash Out" the old
                        one&nbsp; Hope this clears it up

After grabbing a great dinner at Guy's
                        Subs, we decided to grab this cache&nbsp;
                        There were some muggles about on this warm
                        June evening, but we were able to find it
                        without much stealth being needed&nbsp;
                        The cache is in great shape and was well hid&nbsp;
                        OCUS #2 for us!&nbsp; SL, TNLN&nbsp;
                        TFTC!

Headed out to Akron for some caching after
                        a midnight shift and some much needed sleep&nbsp;
                        Hit the park a little after 1 pm&nbsp;
                        While there were tons of cars there, I saw
                        almost no one&nbsp; With the park to
                        myself, I was able to make the grab&nbsp;
                        I sat under the gazebo to sign the log and
                        then rehid&nbsp; Nice hide&nbsp; TFTC

Must have been some of Akrons finest youths
                        hanging out up there as usual&nbsp; Sorry
                        your time didn't yield better results&nbsp;

I was unable to rate the cache and could
                        only log it from my phone the password would
                        not work on my computer, kinda odd&nbsp;

This cache can now be found at:&nbsp; N
                        42 40283 W 077 20137&nbsp; This is right
                        along the way if you are hunting one of the
                        oldest existing geocaches, GC39&nbsp;

                        I actually dropped it off last week, but am
                        still getting caught up with everything&nbsp;
                        Sorry for the delay!!

                        &nbsp;

I was happy visit here and get out of the
                        stiff wind I encountered on the waterfront&nbsp;
                        Cache was right where I figured it would be&nbsp;
                        TFTC

Well, this is my very first Open Cacheat
                        the reccommendation of the Cache Owner!&nbsp;
                        I tried to find another one today, but was
                        wondering if the snow got in the way&nbsp;
                        Oh wellhere is my log and photo!

&lt;p&gt;Finally made it out here
                        today Nice that the memoral was kept up and
                        snow removed Answered the prescribed
                        questions and took a&amp;nbsp;picture A
                        lousy one at that I wish I had a front facing
                        camera on my phone All in all nice virtual
                        Once I figure out how to get the picture
                        logged I'll edit my post Until then I'll
                        email the answers &lt;/p&gt;
                        &lt;p&gt;Nice job &lt;/p&gt;
                        &lt;p&gt;Thanks Mr Yuck&lt;/p&gt;
