I did a little caching in the area so I
                        thought I'd give this one a try&nbsp;
                        There were too many muggles and dogs on the
                        Island to searche for the other cache I was
                        seeking so I decided to take the half mile
                        walk&nbsp; I enjoyed the scenery, which
                        included a big turtle and a great blue heron&nbsp;
                        GPS was a little flakey at the zero but
                        eventually I figured out where I needed to be&nbsp;
                        Quick inspection yielded something that
                        looked a bit out of place&nbsp; The cache
                        was quickly in hand&nbsp; TFTC!&nbsp;
